const CarouselSet = ({ viewSet }) => {
  return (
    <div className={styles.showSet}>
      <ul>
        {viewSet.map((restaurant, i) => (
          <li key={i}>
            <CarouselSingle restaurant={restaurant} />
          </li>
        ))}
      </ul>
    </div>
  );
};

export default CarouselSet;
